import React from "react";
import ReactDOM from "react-dom";
import Card from './Cards';
import Sdata from './Sdata';
console.log(Sdata[0]);

function ncard(val,ind,arr) {
  return (
    <Card
      imgSrc={Sdata[0].imgSrc}
      sname={Sdata[0].sname}
      title={Sdata[0].title}
      links={Sdata[0].links}
    />

  )
}

ReactDOM.render(
  <>

  <h1>List of Series</h1>

    Sdata.map(ncard)

  </>,
  document.getElementById("root")
);
